import{_ as a,o as t,c as e,e as l}from"./chunks/framework.78e651f5.js";const r="/assets/1jyrp2FyoYo.ef1be9e4.jpg",o="/assets/uFBuWceHTSk.9b9c374d.jpg",k=JSON.parse('{"title":"Класс труда","description":"Открытая мастерская","frontmatter":{"title":"Класс труда","description":"Открытая мастерская","date":"2014-11-13","icon":"0Yk7Li3l8lY.jpg","cover":"kkxAaYij6ns.jpg","url":"http://klasstrueda.ru/","tel":"+7 (911) 245-40-00","address":"Профессора Попова 38,корпус Р, 3 этаж.","city":"г. Санкт-Петербург","place":"Завод Ригель, Петроградский район","coord":[59.971318232428985,30.29803589896447],"vk":"true_da","instagram":"klasstrueda","facebook":"klasstrueda","youtube-channel":"UCXIbv2Y_Qvy3sxvluUDA6XQ","youtube":"https://youtu.be/DLdAOGJXpiw","status":"open"},"headers":[],"relativePath":"workshop/catalog/klass-truda/index.md","filePath":"workshop/catalog/klass-truda/index.md"}'),i={name:"workshop/catalog/klass-truda/index.md"},s=l('<h2 id="открытая-мастерская-для-творческои-работы" tabindex="-1">Открытая мастерская для творческой работы. <a class="header-anchor" href="#открытая-мастерская-для-творческои-работы" aria-label="Permalink to &quot;Открытая мастерская для творческой работы.&quot;">​</a></h2><p>Для посетителей — возможность доступа к набору оборудования и инструментов, позволяющему реализовать любые творческие замыслы.</p><p>От м. &quot;Петроградская&quot; - 10 минут, м. Чкаловская - 7 минут пешком.</p><h2 id="инструменты" tabindex="-1">Инструменты <a class="header-anchor" href="#инструменты" aria-label="Permalink to &quot;Инструменты&quot;">​</a></h2><ul><li>Ручной электроинструмент: дрели, шуруповерты, шлифовальные машинки (ленточные и вибрационные), электролобзики, ручные фрезеры, присадочный фрезер, перфоратор, болгарки(УШМ)</li><li>Заточной станок</li><li>Торцовочная пила Энкор-корвет 4-430</li><li>Циркулярный станок EINHELL</li><li>Лобзиковый станок JET JSS16</li><li>Рейсмусовый станок JET JWP12</li><li>Шлифовальный станок JET JSG64</li><li>Токарный станок Корвет 73</li><li>Муфельная печь для обжига керамики.</li><li>Швейные машинки, утюги,гладильная доска.</li><li>Набор инструментов для ювелирных работ: верстак, тиски, фенагели, лобзики, горелка, бормашина, надфели, кусачки, расходные материалы (шлифшкурка, кислота, проволока, припой и т.д.).</li></ul><p><img src="'+r+'" alt=""></p><h2 id="возможности" tabindex="-1">Возможности <a class="header-anchor" href="#возможности" aria-label="Permalink to &quot;Возможности&quot;">​</a></h2><ul><li><h5 id="приобрести-абонемент-и-работать-в-мастерскои" tabindex="-1">Приобрести абонемент и работать в мастерской: <a class="header-anchor" href="#приобрести-абонемент-и-работать-в-мастерскои" aria-label="Permalink to &quot;Приобрести абонемент и работать в мастерской:&quot;">​</a></h5></li></ul><p>Абонемент на <strong>1 день</strong>. Возможность использовать все оборудование и инструменты мастерской с 12 до 23 часов. Стоимость <strong>700 рублей</strong>.</p><p>Абонемент на 10, 20 и 30 часов. Действует в течение 3 месяцев со дня покупки, возможно использовать абонемент одновременно для нескольких человек. По этому абонементу доступно все оборудование мастерской ежедневно с 12 до 23.</p><p>10 часов <strong>1500 рублей</strong> (150 рублей/час); 20 часов <strong>2400 рублей</strong> (120 рублей/час); 30 часов <strong>3000 рублей</strong> (100 рублей/час);</p><p>Абонемент на 1 месяц с возможностью хранения инструментов/материалов и индивидуальным рабочим местом. Стоимость абонементов <strong>6000 рублей/в месяц</strong>.</p><ul><li><h5 id="записаться-на-один-из-курсов-или-мастер-классов" tabindex="-1">Записаться на один из курсов или мастер-классов <a class="header-anchor" href="#записаться-на-один-из-курсов-или-мастер-классов" aria-label="Permalink to &quot;Записаться на один из курсов или мастер-классов&quot;">​</a></h5></li></ul><p>Список курсов, мастер-классов и событий постоянно меняется, удобнее следить за актуальным расписанием.</p><ul><li><h5 id="посетить-индивидуальное-занятие-с-мастерами" tabindex="-1">Посетить индивидуальное занятие с мастерами. <a class="header-anchor" href="#посетить-индивидуальное-занятие-с-мастерами" aria-label="Permalink to &quot;Посетить индивидуальное занятие с мастерами.&quot;">​</a></h5></li></ul><p>Класс Труда объединяет много талантливых мастеров. Индивидуальные занятия с мастерами способствуют не только получению новых знаний и навыков, но и помогают отдохнуть от офисных будней в творческой атмосфере. Стоимость: от <strong>1500 рублей</strong> за занятие</p><ul><li><h5 id="провести-мастер-класс" tabindex="-1">Провести мастер-класс. <a class="header-anchor" href="#провести-мастер-класс" aria-label="Permalink to &quot;Провести мастер-класс.&quot;">​</a></h5></li></ul><p>К вашим услугам большие столы 1.5х1.5 метра для компании 8-10 человек, чай-кофе-печеньки. Мы сделаем анонсы вашего мероприятия в группе Класса Труда и проведем небольшую фотосъемку.</p><p>Стоимость аренды места для проведения мастер-класса: <strong>300 руб./час</strong> в будни до 17:00 <strong>400 руб./час</strong> в будни вечером и в выходные/праздничные дни.</p><p>Если вы талантливый мастер, мы готовы рассмотреть индивидуальную работу с вами, организацию курсов и тп.</p><ul><li><h5 id="заказать-нам-изготовление-изделии-из-дерева-металла-и-тп" tabindex="-1">Заказать нам изготовление изделий из дерева, металла и тп. <a class="header-anchor" href="#заказать-нам-изготовление-изделии-из-дерева-металла-и-тп" aria-label="Permalink to &quot;Заказать нам изготовление изделий из дерева, металла и тп.&quot;">​</a></h5></li></ul><p>Если вы хотите сделать что-то оригинальное, у вас есть идея и желание её воплотить, но нет времени или навыка сделать это самостоятельно, то мы можем вам помочь. Спроектируем, рассчитаем стоимость, посоветуем оптимальный вариант.</p><ul><li><h5 id="арендовать-мастерскую-под-частное-мероприятие-до-50-человек" tabindex="-1">Арендовать мастерскую под частное мероприятие (до 50 человек). <a class="header-anchor" href="#арендовать-мастерскую-под-частное-мероприятие-до-50-человек" aria-label="Permalink to &quot;Арендовать мастерскую под частное мероприятие (до 50 человек).&quot;">​</a></h5></li></ul><p>Вы можете арендовать всю мастерскую или один из 3х залов ( 85, 70 и 25 метров) для проведения корпоративного мероприятия, дня рождения, закрытого мастер-класса и т.п. Мы можем организовать для вас мастер-классы по различным направлениям с опытными мастерами. Работаем как с физическими, так и с юридическими лицами.</p><ul><li><h5 id="арендовать-мастерскую-под-массовое-мероприятие" tabindex="-1">Арендовать мастерскую под массовое мероприятие. <a class="header-anchor" href="#арендовать-мастерскую-под-массовое-мероприятие" aria-label="Permalink to &quot;Арендовать мастерскую под массовое мероприятие.&quot;">​</a></h5></li></ul><p>Мастерская находится в пешей доступности от м. Петроградская (5 минут). Вы можете арендовать всю мастерскую или один из 3х залов ( 85, 70 и 25 метров). Мы заинтересованы в проведении мероприятий на нашей площадке и всегда поддержим интересную идею и новое начинание.</p><h6 id="а-также-провести-фото-и-видео-съемку-свадебные-сборы-и-т-п" tabindex="-1">... а также провести фото и видео съемку, свадебные сборы, и т.п. <a class="header-anchor" href="#а-также-провести-фото-и-видео-съемку-свадебные-сборы-и-т-п" aria-label="Permalink to &quot;... а также провести фото и видео съемку, свадебные сборы, и т.п.&quot;">​</a></h6><p><img src="'+o+'" alt=""></p>',28),n=[s];function h(d,u,p,c,_,b){return t(),e("div",null,n)}const m=a(i,[["render",h]]);export{k as __pageData,m as default};
